 on the grass under the old apple tree. The bird was very small and looked scared and hungry. It couldn’t fly and barely had feathers on its red skin. It was clear that it had fallen from the nest built on one of the branches. Therefore, Karim and I decided to help the poor, little bird. I climbed up the ladder that was placed next to the tree, and with the help of Karim, I safely placed the bird back in its nest where three other baby birds were cooing softly. Karim and I felt very happy that we were able to help the poor bird go back home.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"8d8c2525-334f-4303-a5d3-d92d811d8c2e\"},{\"params\":{\"inputFieldSize\":\"1\",\"requiredField\":true,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>1. Title:</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"2d4b3d3f-0f91-41d8-b3cc-b4bd996a7b12\"},{\"params\":{\"inputFieldSize\":\"1\",\"requiredField\":true,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>2. Setting - When?</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"d9c079be-f133-4f5b-a26c-a54c851125c3\"},{\"params\":{\"inputFieldSize\":\"1\",\"requiredField\":true,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>3. Setting - Where?</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"7e79880f-13d3-4b4e-976a-cd31c61df139\"},{\"params\":{\"inputFieldSize\":\"1\",\"requiredField\":true,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>4. Character(s): </p>\\n\"},\"library\":\"H5P.TextInputFie ng in the backyard.</p>\\n\\n<p><strong>6. Problem:</strong></p>\\n\\n<p>    They found a little baby bird which had fallen from its nest.</p>\\n\\n<p><strong>7. Solution:</strong></p>\\n\\n<p>    The author climbed up a ladder and placed the little bird back in the nest.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"0dde1bd1-95d8-4519-8353-46b5b1647930\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Answer Key\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Answer Key\"},\"subContentId\":\"0040aa9f-795c-4cf5-a28b-2488314e32e0\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"My Story with an Animal\",\"authors\":[],\"changes\":[],\"extraTitle\":\"My Story with an Animal\"},\"subContentId\":\"1c288571-75a2-402c-bf92-efd56ce36cde\"},\"useSeparator\":\"disabled\"},{\"content\":{\"params\":{\"text\":\"<h3><strong>Activity 2</strong></h3>\\n\\n<p>Come up with your own story.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"7862a1c4-5f54-414a-bdc7-9e02ffb1703c\"},\"useSeparator\":\"enabled\"},{\"content\":{\"params\":{\"taskDescription\":\"My Story with an Animal\",\"pagesList\":[{\"params\":{\"elementList\":[{\"params\":{\"decorative\":false,\"contentName\":\"Image\",\"alt\":\"animals\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAA+MAAAC/CAYAAACVIA3BAAAABGdBTUEAALGPC/xhBQAAACBjSFJNAAB6JgAAgIQAAPoAAACA6AAAdTAAAOpgAAA6mAAAF3CculE8AAAAhGVYSWZNTQAqAAAACAAFARIAAwAAAAEAAQAAARoABQAAAAEAAABKARsABQAAAAEAAA
